Twenty years ago, Hurricane Katrina took lives, uprooted families, and left New Orleans and the Gulf Coast forever changed. Houston welcomed more than 200,000 survivors who were failed by their government, and Congress rebuilt FEMA so it would never happen again.

Today, Trump is tearing that work apart as we enter peak hurricane season. We cannot afford to cut @fema, @NOAA, and the @NWS. Harris County is one of the most at-risk counties in America for hurricanes. We must not let Trump and his allies get away with this.

