Eight years ago, Hurricane Harvey left a lasting mark on our city. We remember the lives lost, the families forever changed, and the communities that rebuilt together. Harvey taught us a hard truth: we must always be ready for the next storm.

That is why Trump’s cuts to FEMA and disaster response are so dangerous. Preparedness saves lives. Texas knows it better than anyone. We cannot afford to forget the lesson Harvey taught us.

